import org.bukkit.event.Listener;
import org.bukkit.event.player.PlayerJoinEvent;
import org.bukkit.plugin.java.JavaPlugin;

import java.io.File;
import java.io.IOException;

public class CustomJoinMessages extends JavaPlugin implements Listener {

    private File configFile;
    private FileConfiguration config;

    @Override
    public void onEnable() {
        // Create config file if it doesn't exist
        configFile = new File.getDataFolder(), "config.yml");
        config = YamlConfiguration.loadConfiguration(configFile);

        // Save default configuration if file doesn't exist
        if (!configFile.exists()) {
            try {
                configFile.createNewFile();
                saveDefaultConfig();
            } catch (IOException e) {
                getLogger().severe("Failed to create config file: " + e.getMessage());
            }
        }

        // Load configuration
        loadConfig();

        // Register event listener
        getServer().getPluginManager().registerEvents(this, this);
    }

    @Override
    public void onDisable() {
        // Save configuration
        saveConfig();
    }

    private void loadConfig() {
        try {
            config.load(configFile);
        } catch (Exception e) {
            getLogger().severe("Failed to load config: " + e.getMessage());
        }
    }

    private void saveConfig() {
        try {
            config.save(configFile);
        } catch (Exception e) {
            getLogger().severe("Failed to save config: " + e.getMessage());
        }
    }

    @EventHandler
    public void onPlayerJoin(PlayerJoinEvent event) {
        // Get player and server instance
        Player player = event.getPlayer();
        Player[] players = getServer().getOnlinePlayers().toArray(new Player[0]);

        // Get custom join message from config
        String message = config.getString("join-message");

        // If message is set, send it to the player
        if (message != null) {
            player.sendMessage(message.replace("{player}", player.getName()));
        }

        // Broadcast join message to all players
        String broadcast = config.getString("join-broadcast");
        if (broadcast != null) {
            for (Player p : players) {
                p.sendMessage(broadcast.replace("{player}", player.getName()));
            }
        }
    }
}

