import org.bukkit.event.player.PlayerCommandSendEvent;
import org.bukkit.event.player.PlayerJoinEvent;
import org.bukkit.event.player.PlayerQuitEvent;
import org.bukkit.plugin.java.JavaPlugin;

import java.util.HashMap;
import java.util.Map;
import java.util.UUID;

public class TPAPlugin extends JavaPlugin implements Listener {

    private Map<UUID, Location> teleportRequests = new HashMap<>();

    @Override
    public void onEnable() {
        getLogger().info("TPA Plugin enabled");
        getServer().getPluginManager().registerEvents(this, this);
        saveDefaultConfig();
    }

    @Override
    public void onDisable() {
        getLogger().info("TPA Plugin disabled");
        reloadConfig();
    }

    @EventHandler
    public void onPlayerCommandSend(PlayerCommandSendEvent event) {
        Player player = event.getPlayer();
        if (player.hasPermission("tpa.use")) {
            if (event.getMessage().startsWith("/tpa")) {
                String[] args = event.getMessage().split(" ");
                if (args.length > 1) {
                    Player target = Bukkit.getPlayer(args[1]);
                    if (target != null) {
                        if (teleportRequests.containsKey(target.getUniqueId())) {
                            Location location = teleportRequests.get(target.getUniqueId());
                            player.teleport(location);
                            teleportRequests.remove(target.getUniqueId());
                            event.setMessage("/tpa accept");
                        } else {
                            event.setMessage("/tpa deny");
                        }
                    } else {
                        event.setMessage("/tpa deny");
                    }
                }
            }
        }
    }

    @EventHandler
    public void onPlayerJoin(PlayerJoinEvent event) {
        Player player = event.getPlayer();
        if (teleportRequests.containsKey(player.getUniqueId())) {
            Location location = teleportRequests.get(player.getUniqueId());
            teleportRequests.remove(player.getUniqueId());
            player.teleport(location);
        }
    }

    @EventHandler
    public void onPlayerQuit(PlayerQuitEvent event) {
        Player player = event.getPlayer();
        if (teleportRequests.containsKey(player.getUniqueId())) {
            teleportRequests.remove(player.getUniqueId());
        }
    }

    public void sendTPA(Player player, Player target) {
        player.sendMessage("Teleporting to " + target.getName() + "'s location...");
        teleportRequests.put(target.getUniqueId(), target.getLocation());
    }
}

