import org.bukkit.plugin.java.JavaPlugin;

import java.util.Random;

public class RTPPlugin extends JavaPlugin implements Listener {

    private static final Random random = new Random();
    private static final double MIN_RADIUS = 1000;
    private static final double MAX_RADIUS = 10000;
    private static final double RADIUS_INCREMENT = 1000;
    private static final long COOLDOWN = 300; // 5 minutes

    @Override
    public void onEnable() {
        this.getServer().getPluginManager().registerEvents(this, this);
    }

    @EventHandler
    public void onPlayerDeath(PlayerDeathEvent event) {
        Player player = event.getEntity();
        if (player.hasPermission("rtpplugin.use")) {
            Location playerLocation = player.getLocation();
            Location newLocation = getRTPLocation(playerLocation);
            player.teleport(newLocation);
            this.saveConfig();
            player.sendMessage("You have been teleported to a new location!");
            this.getScheduler().scheduleSyncDelayedTask(this, this::resetCooldown, COOLDOWN * 20);
        }
    }

    private Location getRTPLocation(Location playerLocation) {
        double radius = Math.max(MIN_RADIUS, MAX_RADIUS - random.nextDouble() * (MAX_RADIUS - MIN_RADIUS));
