        int y = (int) (playerLocation.getY() + random.nextDouble() * 2 * radius - radius);
        int z = (int) (playerLocation.getZ() + random.nextDouble() * 2 * radius - radius);
        return new Location(playerLocation.getWorld(), x, y, z);
    }

    private void resetCooldown() {
        this.getConfig().set("cooldown", System.currentTimeMillis());
        this.saveConfig();
    }

