import org.bukkit.inventory.meta.ItemMeta;

import java.util.ArrayList;
import java.util.List;
import java.util.Objects;

public class GiveItemCommand implements CommandExecutor {

    @Override
    public boolean onCommand(CommandSender sender, Command command, String label, String[] args) {
        // Check if the command sender is a player
        if (!(sender instanceof Player player)) {
            sender.sendMessage(ChatColor.RED + "This command can only be run by a player.");
            return true; // Command handled, but not by a player
        }

        // Check for permission
        if (!player.hasPermission("customitemplugin.giveitem")) {
            player.sendMessage(ChatColor.RED + "You do not have permission to use this command.");
            return true; // Command handled, but permission denied
        }

        // Create the custom item stack
        ItemStack customItem = new ItemStack(Material.DIAMOND_SWORD); // Example material

        // Get the item meta to customize it
        ItemMeta meta = customItem.getItemMeta();

        // Null check for item meta (should not be null for non-AIR materials)
        if (meta == null) {
            player.sendMessage(ChatColor.RED + "Failed to create custom item meta. Please contact an administrator.");
            return true;
        }

        // Set custom display name
        meta.setDisplayName(ChatColor.GOLD + "" + ChatColor.BOLD + "Legendary Blade of Power");

        // Set custom lore
        List<String> lore = new ArrayList<>();
        lore.add(ChatColor.GRAY + "A blade forged in the heart of a star.");
        lore.add(ChatColor.GRAY + "It hums with ancient magic.");
        lore.add(""); // Empty line for separation
        lore.add(ChatColor.DARK_PURPLE + "" + ChatColor.ITALIC + "Forged by the Ancients");
        meta.setLore(lore);

        // Add enchantments
        // Using `addEnchant` with `true` allows adding unsafe enchantments (e.g., above vanilla max level)
        // For standard enchantments, `false` is usually sufficient.
        meta.addEnchant(Enchantment.SHARPNESS, 5, true); // Sharpness V
        meta.addEnchant(Enchantment.FIRE_ASPECT, 2, true); // Fire Aspect II
        meta.addEnchant(Enchantment.UNBREAKING, 3, true); // Unbreaking III

        // Add item flags to hide default enchantment tooltips (optional, but good for custom items)
        meta.addItemFlags(ItemFlag.HIDE_ENCHANTS, ItemFlag.HIDE_ATTRIBUTES);

        // Apply the modified meta back to the item stack
        customItem.setItemMeta(meta);

        // Give the item to the player
        player.getInventory().addItem(customItem);

        // Send a confirmation message to the player
        player.sendMessage(ChatColor.GREEN + "You have received the " + ChatColor.GOLD + "" + ChatColor.BOLD + "Legendary Blade of Power" + ChatColor.GREEN + "!");

        return true; // Command successfully handled
    }
}

