import org.bukkit.configuration.file.FileConfiguration;
import org.bukkit.configuration.file.YamlConfiguration;
import java.io.File;
import java.io.IOException;

public class EconomyPlugin extends JavaPlugin implements Listener {

    private FileConfiguration config;
    private File configFile;

    @Override
    public void onEnable() {
        // Create config file if it doesn't exist
        configFile = new File(getDataFolder(), "config.yml");
        if (!configFile.exists()) {
            configFile.getParentFile().mkdirs();
            saveDefaultConfig();
        }

        // Load config file
        config = YamlConfiguration.loadConfiguration(configFile);

        // Register listener
        getServer().getPluginManager().registerEvents(this, this);
    }

    @Override
    public void onDisable() {
        // Save config file
        try {
            config.save(configFile);
        } catch (IOException e) {
            Bukkit.getLogger().severe("Failed to save config file");
        }
    }

    @EventHandler
    public void onPlayerJoin(PlayerJoinEvent event) {
        // Give player 100 coins when they join
        event.getPlayer().sendMessage("You have been given 100 coins");
        // Save player's balance to config file
        config.set(event.getPlayer().getName() + ".balance", 100);
        try {
            config.save(configFile);
        } catch (IOException e) {
            Bukkit.getLogger().severe("Failed to save config file");
        }
    }

    @EventHandler
    public void onPlayerQuit(PlayerQuitEvent event) {
        // Save player's balance to config file
        config.set(event.getPlayer().getName() + ".balance", getBalance(event.getPlayer()));
        try {
            config.save(configFile);
        } catch (IOException e) {
            Bukkit.getLogger().severe("Failed to save config file");
        }
    }

    public int getBalance(org.bukkit.entity.Player player) {
        // Get player's balance from config file
        return config.getInt(player.getName() + ".balance");
    }

    public void addBalance(org.bukkit.entity.Player player, int amount) {
        // Add amount to player's balance
        int balance = getBalance(player);
        balance += amount;
        config.set(player.getName() + ".balance", balance);
        try {
            config.save(configFile);
        } catch (IOException e) {
            Bukkit.getLogger().severe("Failed to save config file");
        }
    }

    public void removeBalance(org.bukkit.entity.Player player, int amount) {
        // Remove amount from player's balance
        int balance = getBalance(player);
        balance -= amount;
        if (balance < 0) {
            balance = 0;
        }
        config.set(player.getName() + ".balance", balance);
        try {
            config.save(configFile);
        } catch (IOException e) {
            Bukkit.getLogger().severe("Failed to save config file");
        }
    }
}

